def minimum_total_cost(n, k, s):
    dp = [[0] * (n + 1) for _ in range(n + 1)]
    dp[0][0] = 2
    for i in range(1, n + 1):
        for j in range(i, n + 1):
            tag = [True] * 26
            for k_idx in range(j, n + 1):
                idx = ord(s[k_idx - 1]) - ord('a')
                if tag[idx]:
                    dp[i][k_idx] += dp[i - 1][j - 1]
                    tag[idx] = False
    ans = 0
    for i in range(n, -1, -1):
        tmp = sum(dp[i])
        if k > tmp:
            k -= tmp
            ans += (n - i) * tmp
        else:
            ans += k * (n - i)
            k = 0
            break
    if k > 0:
        return -1
    return ans

